import "./../css/components/result.css";

export default function Results({ winner, draw }) {
console.log(winner);
console.log(draw);
    return (
        <div className="results">
            <div className={`wrapper${winner ? ' active' : ''}`}>
                {draw ?
                    <div className="text">
                        <span>it's a</span>
                        <span>draw!</span>
                    </div>
                    :
                    <div className="text">
                        <span>{winner.name}</span>
                        <span>won!</span>
                    </div>
                }
            </div>
        </div>
    );
}
